window.bookSummaryJSON = "<p>Bogart casts aside his humble origins, becoming an adventurer. He must gain levels in the guild and fight alongside his allies, both within and outside the law. For fame and fortune! Maybe even to save the world. But mostly for fame and fortune!</p> <p>You only get one chance at the big leagues, and nobody knows it better than Bogart. He's going straight from the badlands to the top of the world, or he'll gladly die trying. If only he knew the truth about the life he's chosen. There are wars, dark gods, and eldritch horrors on the horizon. And nothing is as it seems. Join Bogart as he quests for riches!</p>"; 
